methods.description:
This method allows to pass filters and save them as default filter state.
This means that after clicking "Reset" in filters modal filters will return to this state.
Format of input parameter for column.type === 'string':
```
[{
  action: 'show',
  operationType: 'all',
  entities: [
    {
       columnId: 'first[string]',
       active: true,
       pattern: 'equals',
       query: 'Wong'
    }
  ]
}]
```
Pattern can be one of `['equals', 'not_equal', 'contains', 'not_contains', 'starts_with', 'ends_with', 'wildcard']`.

Format for column.type === 'date':
```
[{
  action: 'show',
  operationType: 'all',
  entities: [
    {
       columnId: 'birth_date[date]',
       active: true,
       dateFrom: '1994-11-12',
       dateTo: '1994-11-12'
    }
  ]
}]
```

Format for column.type === 'number':
```
[{
  action: 'show',
  operationType: 'all',
  entities: [
    {
       columnId: 'age[number]',
       active: true,
       condition: 'equals',
       value: 1
    }
  ]
}]
```

Condition can be one of `['equals', 'not_equal', 'greater_than', 'less_than', 'equals_or_greater_than', 'equals_or_less_than']`.
Also, `leftBound` and `rightBound` properties can be used instead of `condition` and `value` in order to filter by number range.

Format:
```
[{
  action: 'show',
  operationType: 'all',
  entities: [
    {
       columnId: 'age[number]',
       active: true,
       leftBound: 1,
       rightBound: 2
    }
  ]
}]
```

properties.description:
Function that provides items lazily. Receives arguments `params`, `callback`:

`params.page` Requested page index

`params.pageSize` Current page size

`params.filters` Currently applied filters

`params.sortOrders` Currently applied sorting orders

`params.parentItem` When expandable table is used, and sublevel items
are requested, reference to parent item of the requested sublevel.
Otherwise `undefined`.

`callback(items, size)` Callback function with arguments:
  - `items` Current page of items
  - `size` Total number of items.

`<px-data-grid>` calls this function lazily, only when it needs more data
to be displayed.

__Also, note that when using function data providers, the total number of items
needs to be set manually. The total number of items can be returned
in the second argument of the data provider callback:__

```javascript
pxDataGrid.dataProvider = function(params, callback) {
  var url = 'https://api.example/data' +
      '?page=' + params.page +        // the requested page index
      '&per_page=' + params.pageSize; // number of items on the page
  var xhr = new XMLHttpRequest();
  xhr.onload = function() {
    var response = JSON.parse(xhr.responseText);
    callback(
      response.employees, // requested page of items
      response.totalSize  // total number of items
    );
  };
  xhr.open('GET', url, true);
  xhr.send();
};
```

__Alternatively, you can use the `size` property to set the total number of items:__

```javascript
pxDataGrid.size = 200; // The total number of items
pxDataGrid.dataProvider = function(params, callback) {
  var url = 'https://api.example/data' +
      '?page=' + params.page +        // the requested page index
      '&per_page=' + params.pageSize; // number of items on the page
  var xhr = new XMLHttpRequest();
  xhr.onload = function() {
    var response = JSON.parse(xhr.responseText);
    callback(response.employees);
  };
  xhr.open('GET', url, true);
  xhr.send();
};
```

